import React, {useState} from 'react';

import UserData from '../../UserData/UserData';
import Cars from '../Cars/Cars';
import Img from '../UI/Img/Img';
import Card from '../UI/Card/Card';
import Wrapper from '../UI/Wrapper/Wrapper';

import classes from './Garage.module.css';
import garageImage from '../../assets/Awesome-garage.jfif';

const Garage = (props) => {
  const [users, setUsers] = useState(JSON.parse(UserData));
  //const users = JSON.parse(UserData);

  const user = users.filter((user) => user.email.includes('zaryooo@gmail.com'));

  const cars = user.map((car) => {
    return car.cars;
  });

  const onEditCars = (car) => {
    const target = user[0].cars;
    const source = car;
    const returnedTarget = Object.assign(target, source);
    user[0].cars = returnedTarget;

    const allUsers = users;
    const editUser = user;
    const makeEdit = Object.assign(allUsers,editUser);
    setUsers(makeEdit);
  };



  return (
    <Wrapper>
      <Img src={garageImage} alt="Awesome garage" />
      <Card className={classes.garage}>
        <Cars userCars={cars[0]} editCars={onEditCars} />
      </Card>
    </Wrapper>
  );
};

export default Garage;
